""" xs are coefficients of a polynomial.
find_zero finds x such that poly(x) = 0.
Returns only one zero point, even if there are multiple.
Assumes xs has even length and largest non-zero coefficient.
"""
n = len(xs)
if n % 2 != 0:
    raise ValueError("List length must be even")

# Find initial interval [a,b] where poly(a) and poly(b) have opposite signs
a = -1000
b = 1000
while poly(xs, a) * poly(xs, b) >= 0:
    if abs(a) < 1e-6:
        a = -1
    else:
        a *= 2
    if abs(b) < 1e-6:
        b = 1
    else:
        b *= 2

# Bisection method with tolerance 1e-6
tolerance = 1e-6
max_iter = 1000
for _ in range(max_iter):
    c = (a + b) / 2
    if abs(poly(xs, c)) < tolerance:
        return round(c, 2)
    if poly(xs, c) * poly(xs, a) > 0:
        a = c
    else:
        b = c
return round((a + b) / 2, 2)

def poly(xs: list, x: float) -> float:
    """Evaluate polynomial with coefficients xs at point x."""
    return sum(coeff * x**i for i, coeff in enumerate(xs))

def poly_derivative(xs: list, x: float) -> float:
    """Evaluate derivative of polynomial with coefficients xs at point x."""
    return sum(i * coeff * x**(i-1) for i, coeff in enumerate(xs) if i > 0)

