def is_first_last_odd(n):
    """Return True if first and last digit of n are odd."""
    n = abs(int(n))
    while n % 10 == 0:
        n //= 10
    last = n % 10
    first = n
    while first >= 10:
        first //= 10
    return first % 2 == 1 and last % 2 == 1

