"""
Return the number of triples (i<j<k) with a[i]+a[j]+a[k] divisible by 3.
a[i] = i*i - i + 1 ≡ i*(i-1) mod 3.
Only residues 0 and 2 modulo 3 appear.
Count triples using combinations of counts of 0 and 2 residues.
"""
if n < 3:
    return 0

count0 = count2 = 0
for i in range(n):
    r = i % 3
    if r == 0:
        count0 += 1
    elif r == 2:
        count2 += 1

# Number of valid triples is C(count0,3) + C(count2,3)
# But we need to handle small counts gracefully
if count0 < 3:
    count0_comb = 0
else:
    count0_comb = count0 * (count0 - 1) * (count0 - 2) // 6

if count2 < 3:
    count2_comb = 0
else:
    count2_comb = count2 * (count2 - 1) * (count2 - 2) // 6

return count0_comb + count2_comb

